    false,nt"url": null,nt"notes": "This narrative report for Medicine Lake
    NWR outlines Refuge accomplishments from August through October of 1938. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, furbearers, predators, rodents,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and collections and receipts. Resource management
    is outlined; topics include grazing, sharecropping, and haying. The public relations
    section of the report describes recreational uses, Refuge visitors, and violations.
    Photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
